import React from "react";
// Componentes //
import Comp1 from "../Components/Inicio/Componente1";
import Comp2 from "../Components/Inicio/Componente2";
import {Footer} from "../Components/General/Footer";
import Copyri from "../Components/General/Copyri";
import Greeting from "../Components/General/WhatsappPNG";
// Stylesheet //
import '../style.css';
import '../Botons.css';

function Home () {
  return (
    <body className="bodyclas">
      <Comp1/>
      <Comp2/>
    </body>
  );
};

export default Home;
